import React from "react";
import Frame36264 from "../Frame36264";
import Frame36194 from "../Frame36194";
import EditEdit from "../EditEdit";
import "./Frame3539.css";

function Frame3539(props) {
  const { image2, surname, x542Kg, frame36264Props, frame36194Props, editEditProps, className } = props;

  return (
    <div className={`frame-35392 border-0-5px-abbey ${className || ""}`}>
      <img className="image-2" src={image2} />
      <div className="frame-36254">
        <div className="surname ibmplexsans-normal-quarter-spanish-white-16px">{surname}</div>
      </div>
      <Frame36264 fruits={frame36264Props.fruits} />
      <div className="frame-362711">
        <div className="x542-kg ibmplexsans-normal-quarter-spanish-white-16px">{x542Kg}</div>
      </div>
      <div className="group-1943">
        <Frame36194 userUserProps={frame36194Props.userUserProps} />
        <div className="frame-36202 border-0-5px-quarter-spanish-white">
          <EditEdit editEdit={editEditProps.editEdit} />
        </div>
      </div>
    </div>
  );
}

export default Frame3539;
